const TestFeed = ({ id, go, fetchedUser }) => (
	<Panel id={id}>
		<PanelHeader>Каталог скинов</PanelHeader>
		{fetchedUser &&
		<Group title="User Data Fetched with VK Bridge">
			<Cell
				before={fetchedUser.photo_200 ? <Avatar src={fetchedUser.photo_200}/> : null}
				description={fetchedUser.city && fetchedUser.city.title ? fetchedUser.city.title : ''}
			>
				{`${fetchedUser.first_name} ${fetchedUser.last_name}`}
			</Cell>
		</Group>}

		<Group title="Navigation Example">
			<Div>
				<Button size="xl" level="2" onClick={go} data-to="persik">
					Show me the Persik, please
				</Button>
			</Div>
		</Group>
    <Group header={<Header mode="secondary">Выберите категорию</Header>}>
      <CellButton onClick={go} data-to="def_skins" >Обычные скины</CellButton>
      <CellButton>Питомцы</CellButton>
      <CellButton>Частицы</CellButton>
      <CellButton>Собственный фон</CellButton>
    </Group>
	</Panel>
);

TestFeed.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
};


export default TestFeed;
